import React from "react";
import MovieCard from "./MovieCard";

function MovieList({ popularList }) {
    console.log(popularList)
    return (
        popularList.map(movie => {
            return <MovieCard key={movie.id} movie={movie}/>;
        })
    );
}

export default MostPopular;
